(1, 1, 'What is your financial objective? Please select the financial objective that is most important to you.', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, 1, 3, 0, 0, 0, NULL, 0, 0, 0, 0, '2018-07-10 12:21:07', '2017-07-15 12:07:05'),
(2, 1, 'What are your financial return expectations in making impact investments?', NULL, '<div><!--block-->Unlike traditional investing, impact investing involves a scale of financial returns.&nbsp; This question is trying to understand whether you are a concessionary or non-concessionary investor.</div>', '<div><!--block-->Many investments such as public stocks fall under risk adjusted market rate impact investments.&nbsp; However, there are other investments such as Microfinance loans that generate below-market rate returns.</div>', '<div><!--block-->By understanding your return expectations, Andorra is able to develop an asset allocation and investment recommendations based on your impact investor profile.</div>', NULL, 1, 1, 1, 1, 1, 2, 0, 0, 0, 0, 0, 0, 0, 0, '2018-07-10 12:21:07', '2017-07-15 12:20:14'),
(3, 1, 'What is your liquidity preference?', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, 1, 3, 0, 0, 0, NULL, 0, 0, 0, 0, '2018-07-10 12:21:07', '2017-07-15 12:25:09'),
(4, 1, 'What is the maximum investment you are willing to make?', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, 5, 7, 0, 0, 0, 1, 0, 0, 0, 0, '2018-07-10 12:21:07', '2017-07-15 12:26:50'),
(6, 1, 'What is your impact objective?', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, 1, 4, 0, 0, 0, NULL, 0, 0, 0, 0, '2018-07-10 12:21:07', '2017-07-15 12:30:31'),
(7, 1, 'How do you want to create impact?', NULL, '<div><!--block-->There are many ways to create impact. &nbsp;Investors can seek to influence the behavior of public companies, scale proven ideas or invest in the early stages of research and development. &nbsp;</div>', '<div><!--block-->An example of a pioneer investor is someone who invests in a salt water purification system. It is a high risk high reward. &nbsp;<br><br>A Scale Investor is investing in a Microfinance institution that wants to scale its operations to another region&nbsp;</div>', '<div><!--block-->By choosing one area, you give us information about the types of investments you are interested in and your risk tolerance.</div>', NULL, 1, 1, 1, 1, 1, 5, 0, 1, 6, NULL, 0, 0, 0, 0, '2018-07-10 12:21:07', '2017-07-15 12:32:08'),
(8, 1, 'How much capital do you want to invest?', NULL, NULL, NULL, NULL, NULL, 1, 1, 1, 1, 5, 6, 0, 0, 0, 1, 0, 0, 0, 0, '2018-07-10 12:21:07', '0000-00-00 00:00:00'),
