(19, 1, 'Are you an accredited investor?', NULL, '<div><!--block-->Accredited Investor: An accredited investor is a person or entity that can deal with securities not registered with financial authorities by satisfying one of the requirements regarding income, net worth, asset size, governance status or professional experience. Requirement: Organizations - An entity is an accredited investor if it is a private business development company or an organization with assets exceeding $5 million. Individuals - To be an accredited investor, a person must demonstrate a</div>', '<div><!--block-->Show example</div>', NULL, NULL, 1, 1, 1, 1, 1, 1, 1, 0, 0, NULL, 0, 1, 0, 0, '2018-07-10 12:21:07', '2017-07-18 23:50:49'),
